function openNav() {
  document.getElementById("mySidenav").style.width = "100%";
}

function closeNav() {
  document.getElementById("mySidenav").style.width = "0";
}

function scrollMenuLight(name) {
  const elTopPosition = document.getElementById(name).getBoundingClientRect().top + window.scrollY
  const elBottomPosition = document.getElementById(name).getBoundingClientRect().top + window.scrollY + document.getElementById(name).getBoundingClientRect().height

  if (window.scrollY > elTopPosition - 10 && window.scrollY < elBottomPosition - 10) {
    document.querySelector(`.${name}-btn`).style.color = '#46A5FC'
  }
  else {
    document.querySelector(`.${name}-btn`).style.color = '#000000'
  }
}

const markLines = document.querySelectorAll('.mark-block__line')
const markTexts = document.querySelectorAll('.mark-block__text')

for (let i = 0; i < markLines.length; i++) {
  markLines[i].style.height = markTexts[i].clientHeight + 'px'
}

document.querySelector('.popup-open').addEventListener('click', () => {
  document.querySelector('.popup-overlay').style.display = 'block'
})

document.querySelector('.popup-close').addEventListener('click', () => {
  document.querySelector('.popup-overlay').style.display = 'none'
})
